import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import LoginLogout from "./components/LoginLogout";

// Pages (simple placeholders)
const Features = () => (
  <div className="p-6">
    <h1 className="text-2xl font-bold text-blue-600 mb-6">Features Page</h1>
    <LoginLogout />
  </div>
);

const Demo = () => (
  <div className="p-6">
    <h1 className="text-2xl font-bold text-blue-600 mb-6">Demo Page</h1>
    <LoginLogout />
  </div>
);

const Download = () => (
  <div className="p-6">
    <h1 className="text-2xl font-bold text-blue-600 mb-6">Download Page</h1>
    <LoginLogout />
  </div>
);

const Pricing = () => (
  <div className="p-6">
    <h1 className="text-2xl font-bold text-blue-600 mb-6">Pricing Page</h1>
    <LoginLogout />
  </div>
);

const Support = () => (
  <div className="p-6">
    <h1 className="text-2xl font-bold text-blue-600 mb-6">Support Page</h1>
    <LoginLogout />
  </div>
);

const FAQ = () => (
  <div className="p-6">
    <h1 className="text-2xl font-bold text-blue-600 mb-6">FAQ Page</h1>
    <LoginLogout />
  </div>
);

const AAMS = () => (
  <div className="p-6">
    <h1 className="text-2xl font-bold text-blue-600 mb-6">Welcome to AAMS Home</h1>
    <LoginLogout />
  </div>
);

const App = () => {
  return (
    <Router>
      <Navbar />
      <div className="pt-6 px-6">
        <Routes>
          <Route path="/aams" element={<AAMS />} />
          <Route path="/features" element={<Features />} />
          <Route path="/demo" element={<Demo />} />
          <Route path="/download" element={<Download />} />
          <Route path="/pricing" element={<Pricing />} />
          <Route path="/support" element={<Support />} />
          <Route path="/faq" element={<FAQ />} />
          <Route path="*" element={<AAMS />} /> {/* Default to home */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
